import axios, { AxiosResponse } from "axios";

const getOneNews = (id: string): Promise<AxiosResponse> => {
  const requestUrl = `https://api.tvmaze.com/shows/${id}`;
  const response = axios.get(requestUrl);
  return response;

};
export default getOneNews;
